import React from 'react';
import { Flex, Text, Box, useColorModeValue } from '@chakra-ui/react';
import { AddIcon, ChatIcon, DownloadIcon, CheckIcon } from '@chakra-ui/icons';
import TimelineRow from './TimelineRow'; // Adjust the import path as needed

const timelineData = [
  { logo: AddIcon, title: 'Foundation', date: '22 DEC 2020', color: 'brand.300' },
  { logo: ChatIcon, title: 'Community Outreach', date: '21 DEC 2021', color: 'blue.300' },
  { logo: DownloadIcon, title: 'Expansion', date: '21 DEC 2022', color: 'orange.300' },
  { logo: CheckIcon, title: 'Tech Conference', date: '20 DEC 2023', color: 'red.300' },
  { logo: CheckIcon, title: 'Milestone', date: '20 DEC 2024', color: 'green.300' },
];

function InteractiveTimeline() {
  const textColor = useColorModeValue('gray.700', 'white.300');
  const bg = useColorModeValue('gray.50', 'gray.700');

  return (
    <Box p="1rem" maxWidth="100%" bg={bg}>
      <Box pt="0px" pb="28px" px="21px" textAlign="center">
        <Flex direction="column">
          <Text fontSize="lg" color={textColor} fontWeight="bold" pb=".5rem">
            Timeline Overview
          </Text>
          <Text fontSize="sm" color="gray.400" fontWeight="normal">
            <Text fontWeight="bold" as="span" color="brand.300">+30%</Text> growth this year.
          </Text>
        </Flex>
      </Box>
      <Box px="26px" mb="31px" position="relative">
        <Flex direction="column">
          {timelineData.map((row, index, arr) => (
            <TimelineRow
              key={index}
              logo={row.logo}
              title={row.title}
              date={row.date}
              color={row.color}
              index={index}
              arrLength={arr.length}
            />
          ))}
        </Flex>
      </Box>
    </Box>
  );
}

export default InteractiveTimeline;
